Update MongoDb data inside a field<p>I have a MongoDb Database with a collection called <code>rooms</code>. In <code>rooms</code>, I want to search for a particular object by the <code>roomId</code> property. I want to update the array contents in the found object. For instance, initially, before making a request to that endpoint, the desired data looks like this:</p>
<pre><code>{
    available: true,
    _id: 60817a403170bf49185c7db7,
    player1: &quot;Jack&quot;,
    player2: &quot;Adam&quot;,
    roomId: &quot;ABCDE&quot;,
    pieces: [
        {
            point: [6, 0],
            player: &quot;1&quot;,
            type: &quot;P&quot;
        },
        ...
    ],
    __v: 0
}
</code></pre>
<p>After making a request like <code>http://localhost:8000/room/ABCDE?x1=6&amp;y1=0&amp;x2=4&amp;y2=0</code>, the data in mongodb should update to</p>
<pre><code>{
    available: true,
    _id: 60817a403170bf49185c7db7,
    player1: &quot;Jack&quot;,
    player2: &quot;Adam&quot;,
    roomId: &quot;ABCDE&quot;,
    pieces: [
        {
            point: [4, 0], /* DATA UPDATED */
            player: &quot;1&quot;,
            type: &quot;P&quot;
        },
        ...
    ],
    __v: 0
}
</code></pre>
<p>This is my <code>api.js</code> file, what should the code be in the comments in order to execute this?</p>
<pre><code>const express = require('express');
const GameRoom = require('../models/room');
const router = express.Router();

router.put('/room/:id', (req, res, next) =&gt; {
    GameRoom.findOne({roomId: req.params.id})
        .then(data =&gt; {
            const pieces = data.pieces;
            for (let i = 0; i &lt; pieces.length; i++) {
                if (pieces[i].point[0] === parseInt(req.query.x1) &amp;&amp;
                        pieces[i].point[1] === parseInt(req.query.y1)) {
                    pieces[i].point = [req.query.x2, req.query.y2];
                    break;
                }
            }         
            // Take the modified pieces array and update it
        }).catch(next);
});
</code></pre>

