Check if the body parameter is not null and update on MongoDB<p>I'm trying to update a document in MongoDB using NodeJS (NextJS). My current code is:</p>
<pre><code>import connect from &quot;../../util/mongodb&quot;;

async function api(req, res) {
    if (req.method === &quot;POST&quot;) {
        const { id } = req.body;
        const { name } = req.body;
        const { email} = req.body;
        const { anything1 } = req.body;
        const { anything2 } = req.body;

        if (!id) {
            res.status(400).json({ &quot;error&quot;: &quot;missing id param&quot; });
            return;
        }

        const { db } = await connect();
        const update = await db.collection(&quot;records_collection&quot;).findOneAndUpdate(
            { id },
            {
                $set: {
                    name,
                    email,
                    anything1,
                    anything2
                }
            },
            { returnOriginal: false }
        );

        res.status(200).json(update);
    } else {
        res.status(400).json({ &quot;error&quot;: &quot;wrong request method&quot; });
    }
}

export default api;
</code></pre>
<p>Everything is working. But I would like to request only the ID as mandatory, and for the other information, leave optional.
In this code, passing the id and name for example, the other three fields (email, anything1 and anything2) will be null in the document.</p>
<p>It is possible to implement the update without requiring all document information and ignore when body fields are null? (As a beginner in NodeJS and MongoDB, the only way to do that that comes to my head now is to surround it all by a lot of if...)</p>

